import React from 'react';
import {NavLink} from 'react-router-dom';
import './Nav.css';
import 'bootstrap/dist/css/bootstrap.css';

function Nav() {
    return (
        <>

        <div className='main bg-secondary py-1 px-3 d-flex align-items-center justify-content-around'>
        <div className='logo'>
            <img src="images/logomovie.png" alt="" />
        </div>
        <div className='menu'>
        <NavLink exact activeClassName="active_class" to="/home.js" > Home</NavLink> 
        <NavLink exact activeClassName="active_class" to="/about.js" > About</NavLink> 
        <NavLink exact activeClassName="active_class" to="/contact.js" >Contact</NavLink> 
        <NavLink exact activeClassName="active_class" to="/services.js" >Services</NavLink> 
        </div>
      
       
      </div>
       </>
    );
}

export default Nav;
